webpackJsonp([0x601a8439c2f2],{1269:function(e,t){e.exports={data:{site:{siteMetadata:{title:"Psyked.co.uk",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/imagesizer-now-with-a-feedback-form/index.md absPath of file >>> MarkdownRemark",html:"<p><img src=\"http://uploads.psyked.co.uk/2009/01/imagesizer043.jpg\" alt=\"ImageSizer 0.4.3\" title=\"ImageSizer 0.4.3\"></p>\n<p>I'm a bit of a slave to my own ideas - why else would I spend my evenings knocking together a whole host of not-really-nessesary features for a simple application?  I have to many ideas I want to impliment and too little time to do it, so I'm also acutely aware that I tend to break things without realising, when I try and rush new features through.  Hopefully though, it'll all turn out ok in the end!</p>\n<p>Today's release of ImageSizer (version 0.4.3) introduces another new feature - the Feedback panel.  Essentially it's just a traditional e-mail contact form - heck, it doesn't even have any validation (yet) - but it should allow anyone who has any ideas or comes across any bugs to drop me a note from within the application.  Kudos to <a href=\"http://blog.pimpelsang.ee/\">Eero Koplimets</a> for taking the time to suggest this feature!</p>\n<p>You can download the latest and greatest version of ImageSizer from the badge in the right hand column, or upgrade automatically from a previous version by either a) Opening ImageSizer or b) Opening the Application Settings panel within ImageSizer, and clicking the button marked 'Check for Updates now'.</p>",frontmatter:{title:"ImageSizer - now with a Feedback form!",date:"January 23, 2009",tags:["imagesizer"]}}},pathContext:{}}}});
